<input id="search" type=text autofocus="">
<div id="results"></div>


<script>
auto = function(){

	s = search.value;
	len = s && s.length || 0;
	if (len<2) return;


	first=s[0]+s[1]

	syn = (x[first] ||'').split(" ").filter((i)=>i.startsWith(s.substr(2))).map((i)=>first+i)

	results.innerHTML = (syn).join(" ")


	search.value = syn[0] || s
	search.setSelectionRange(len, search.value.length)

}

search.onkeyup= function(e){
	if (e.keyCode==8) return;
	if (e.keyCode==13) {
		getSelection().collapseToEnd();
		search.value += " "
	}
	clearTimeout(this.func)
	this.func=setTimeout(auto,100)
}
</script>
